import React from 'react';
import classes from './Input.module.css';

const Input = (props) => {
  return (
    <>
    <label className={`${classes.input} ${props.classes}`}>{props.label}</label>
    <input className={`${classes.input} ${props.classes}`}></input>
    </>
  );
};

export default Input;
